import * as React from 'react';
import { StyleSheet, View } from 'react-native'
import { TextInput } from 'react-native-paper';

const Form = () => {
  const [text, setText] = React.useState("");

  return (
    <View>
      <TextInput
        label="Email"
        value={text}
        onChangeText={text => setText(text)}
         style={styles.input}
      />
      <TextInput
        label="Email"
        value={text}
        onChangeText={text => setText(text)}
      />
      <TextInput
        label="Email"
        value={text}
        onChangeText={text => setText(text)}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  input: {
  marginBottom : 10,
}

})


export default Form;
